                <th>IT</th>
                <th>Comps</th>
                <th>EXTC</th>
                <th>ETRX</th>
            </tr>
        </thead>
        {% for details in details %}
        <tr style="text-align:center;font-size:16px;">
            <td>{{forloop.counter}}</td>
            <td>{{details.comp_name}}</td>
            <td>{{details.ctc}}</td>
            <td>{{details.eligibility}} %</td>
            <td class="student">{{it}}</td>
            <td class="student">{{comps}}</td>
            <td class="student">{{extc}}</td>
            <td class="student">{{etrx}}</td>
            <td id="total"></td>
        </tr>
        {% endfor %}
    </table>
      </div>
</body>
</html>
